import React from 'react';

import "./styles.css"

interface BoardButtonProps {
	keyID: string,
	tileName: string,
	onClick: () => void,
}

const BoardButton: React.FC<BoardButtonProps> = ({keyID, tileName, onClick}) => {
	return (
		<div>
			<div className={tileName} key={keyID} onClick={onClick}></div>
		</div>
	)
}

export default BoardButton;
